import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Profile.css';

function Profile({ setTempDsaScore }) {
  const [dsaScore, setDsaScore] = useState('');
  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    setTempDsaScore(parseInt(dsaScore, 10));
    navigate('/login');
  };

  return (
    <div className="profile-container">
      <h1>Enter Your DSA Score</h1>
      <form onSubmit={handleSubmit} className="profile-form">
        <div className="form-group">
          <label htmlFor="dsaScore">DSA Score:</label>
          <input
            type="number"
            id="dsaScore"
            value={dsaScore}
            onChange={(e) => setDsaScore(e.target.value)}
            required
            min="0"
          />
        </div>
        <button type="submit" className="submit-button">Proceed to Login</button>
      </form>
    </div>
  );
}

export default Profile;
